 not common to have pedestrians. However, with an average value of 0.22 and a maximum of 8, further investigation into this data is warranted.\n","\n","- **Number of Vehicle Occupants Involved (PERSONS):** The average number of vehicle occupants involved is 2.1 (PERMVIT). The number of drivers and occupants of vehicles in circulation involved has an average value of 2.1. These two variables capture the same information but quantify it differently. The accident with the highest number of occupants involves 61 individuals.\n","\n","- **Number of Pedestrians, Cyclists, Persons in Parked Vehicles, and Others (PERNOTMVIT):** In this category, including pedestrians, cyclists, persons in parked vehicles, and others, the average increases slightly compared to pedestrians alone. This suggests that more cases are included in this broader category.\n"]},{"cell_type":"markdown","id":"60951f74","metadata":{"papermill":{"duration":0.01247,"end_time":"2024-01-24T14:58:01.858551","exception":false,"start_time":"2024-01-24T14:58:01.846081","status":"completed"},"tags":[]},"source":["**Alcohol Presence in Drivers:**\n","\n","We observe that, percentage-wise, in the vast majority of accidents, around 75% of the cases show no presence of alcohol in the driver. Positive cases, where alcohol is detected, are around 22%. We sought to compare this data with other countries and found that these values fall within a central range, where the maximum values by country exceed 50%, and the minimum values are above 10%.\n"]},{"cell_type":"code","execution_count":7,"id":"f7725cb2","metadata":{"execution":{"iopub.execute_input":"2024-01-24T14:58:01.88833Z","iopub.status.busy":"2024-01-24T14:58:01.886485Z","iopub.status.idle":"2024-01-24T14:58:02.036649Z","shell.execute_reply":"2024-01-24T14:58:02.033688Z"},"papermill":{"duration":0.168424,"end_time":"2024-01-24T14:58:02.039833","exception":false,"start_time":"2024-01-24T14:58:01.871409","status":"completed"},"tags":[]},"outputs":[{"data":{"text/htm